import React from "react";
import htmlFoto from './htmlft.png';
import './specifications.css';
import javaFoto from './javascript.png';
import reactFoto from './react.png';
import nodeFoto from './node.png';
import typeFoto from './typescript.png';
import sqlFoto from './sql.png';

var imagem = document.getElementById("html");
  var tooltip = document.getElementById("tooltip");

  imagem.onmouseover = function() {
    tooltip.style.display = "block";
  }

  imagem.onmouseout = function() {
    tooltip.style.display = "none";
  }

function Especificacoes () {
    return(

<div className="especificacaoes">

    <div className="espp-content">

     <div className="esp um" ><img id="html" src={htmlFoto}  />
     <div id="tooltip"><h1>ASASASAASASAfd
        dsasadasddasasdasdssddsasdasasddsaSASASASASASASASASASAS</h1></div>
     </div>
    


     <div className="esp dois"  > <img id="js" src={javaFoto}  />
     </div>

     <div className="esp tres"><img id="rt" src={reactFoto}  />
     </div>

     <div className="esp quatro"><img id="nd" src={nodeFoto}  />
     </div>

     <div className="diferente"> 
     </div>
     <div className="esp cinco"  > <img id="ts" src={typeFoto} />
     </div>

     <div className="esp seis"><img id="sql" src={sqlFoto}  />
     </div>

</div>


</div>
    )
}

export default Especificacoes
